apiVersion: v1
kind: Namespace
metadata:
  name: nephe-system
---
apiVersion: v1
kind: Service
metadata:
  annotations:
  name: nephe-controller-service
  namespace: nephe-system
spec:
  ports:
  - port: 443
    protocol: TCP
  type: ClusterIP
---
apiVersion: v1
kind: Endpoints
metadata:
  labels:
    kubernetes.io/service-name: nephe-controller-service
  name: nephe-controller-service
  namespace: nephe-system
subsets:
- addresses:
  - ip: 100.67.252.253
  ports:
  - port: 443
    protocol: TCP
---
apiVersion: apiregistration.k8s.io/v1
kind: APIService
metadata:
  annotations:
    #cert-manager.io/inject-ca-from: nephe-system/serving-cert
  name: v1alpha1.runtime.cloud.antrea.io
spec:
  caBundle: 
  group: runtime.cloud.antrea.io
  groupPriorityMinimum: 100
  service:
    name: nephe-controller-service
    namespace: nephe-system
  version: v1alpha1
  versionPriority: 100
---
